INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (196,'040','마른마른 용이 드디어 물을 얻어 마시니 재수가 무궁무진하여 말썽지 않고 잘 형통하게 되겠습니다. 그러나 아무 곳이나 함부로 뛰어들지 마십시오. 산길과 불길을 걸어야 함을 잊어서는 안됩니다. 신상에 무로움이 있으니 누가 있어 속마음을 속속들이 알아주겠습니까. 그러나 처음은 곤하고 뒤에는 형통하니 늘거라도 필히 재물을 얻게될 것입니다. 기쁨과 근심이 상반이니 길흉 또한 상반입니다. 웃고 우는 것은 곧 생활인 것입니다. 관재와 구설을 간간히 있을 것이니 이것이 흉하게 되겠습니다. 원한이 서로 목을 부비거나 다른 무리가 어찌 감히 참어 들고자 하겠습니까. 길이 산길이므로 누가 길을 일러줄 것이며 누가 친하게 접근할 수 있겠습니까?','소망이 뜻대로 이루어지는데 일이 아직 풀리지 않은 의심이 남아있으니 무엇입니까. 산길을 말을 타고 달려가니 길이 얼마나 험하고 어렵겠습니까. 어려서는 다시 많이 잃게 되어 도리어 없는 것만 못하겠습니다. 그래도 길을 끝내 헤쳐나가야 되지 않겠습니까?','여기저기를 배회하며 하늘을 바라다보니 마지막 들어오는 길에야 재물을 얻겠습니다. 만약에 후의가 없으면 도리어 복을 입게 될 것이니 주의하십시오. 재물이 길 가운데 있으니 실행하면 가히 얻을 수 있겠습니다. 보이거든 주저하지 말고 가서 얻도록 하십시오.','천리타황에서 고독하고 외로운 신세가 되었으니 지팡이기도 박들고 싶겠습니다. 그러나 다른 사람의 말을 함부로 믿지 마십시오. 도리어 흐뭇한 꿈을 보게 될 것입니다. 동쪽과 서쪽을 가까이 하지 마십시오. 손해에 실심이 시작하고 끝물음에 주의하십시오.','달이 검은 구름에 들어왔으니 동서남북을 분간하기 어렵게 되었습니다. 만약에 신변이 아니라면 신중에 근심이 있을 것이니 건강에 유의하고 집을 잘 살피십시오. 사람들이 나의 일을 욕심히 시기할 것이니 다치지 않도록 주의하십시오.','서쪽과 북쪽 양방은 반드시 흉함이 있으니 일을 마무리 지을 때 주의하십시오. 동서양방은 반대로 좋을 것이니 일을 시작하고 끝물을 때 잘 살펴야 합니다. 안은 물의 고기가 바다로 나간 것이니 그 꼬리가 양양하고 즐겁겠습니다.','산에 들어가서 도를 닦으니 가히 신선을 이런 듯이 인생이 고고해 보인 것입니다. 동남방은 길함이 있으니 일을 시작하고 버림 때 박차를 가해야 합니다. 그러나 후사를 조심하십시오. 흉식함이 문밖에서 엿보고 있습니다. 조심하면 가히 면할 수 있습니다.','다른 사람과 함께 일을 도모하게 되면 그 일을 실패하게 될 것입니다. 일에 마찰이 많았으니 몰리 떠나거나 원대한 계획을 세우는 것은 불리하겠습니다. 본래 재물이 없으면 몸이 무렵고 수고로운 것이니 이를 알고 잘 갖추내야 할 것입니다.','사람은 잘 못 사귀었던 결과로 손해를 볼 것이니 미리 사람 대하기를 유의하십시오. 그렇다고 인간 관계를 소홀히 해서는 이익을 면하게 될 것이니 이익도 사람관계에 있음을 알아야 합니다. 만약 남의 도움을 받게 된다면 상금을 달리 얻을 수 있을 것입니다.','외부에 나가거나 밖의 일을 꾀하지 마십시오. 손해가 있고 이익은 없을 것입니다. 기쁨과 근심이 서로 섞였으니 범은 길하고 범을 흉합니다. 잘 처신해야 합니다. 일신이 공고하고 마음에 번민이 많으나 밖으로 표현하지 말고 남과 함께 일을 도모하지 마십시오.','가을 한 봄중에 집을 생각하며 스스로 한탄할 일이 생기겠습니다. 분수를 지키지 않고 행동하면 이와 같은 것이요 분수를 지키며 평안히 안거하면 이 수를 면할 수 있을 것입니다. 동방으로 오는 손님은 반드시 악한 사람이니 함께 일을 도모하지 마십시오.','해가 서산에 비치니 돌아가는 길손에 갈 길이 밝혀진 것입니다. 어서 서둘러야 합니다. 맹사를 이루기가 쉽지 않으니 분수를 지켜이 상책일 것입니다. 만약 관재수가 아니라면 구설이 끊어지지 않고 이어질 것이니 분수를 지켜야 합니다.','재물을 얻으려고 노력하면 가히 얻을 수 있겠습니다. 글쓴이의 운수는 분주하기는 해도 그만큼 이익을 얻기는 어려우니 다심을 기약하고 만족해야 합니다. 집에 불평함이 있고 반드시 손재수가 있으므로 기도로서 얼을 면해야겠습니다.','2025-03-02 11:57:20.396773+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (409,'040','干龙终于得到了水，所以运气是无尽的，并且会没有麻烦。但是不要跳入任何地方。不要忘记，您必须在山路和火焰上行走。有很多想法，那么谁会彼此了解内心？但是一开始，这很难，您的后背会很繁荣，因此即使您增加了，也会获得财富。欢乐和焦虑是上半部分，因此吉尔也是上半部分。笑和哭泣是生活。偶尔会有一个管理和整合，所以这将是丑陋的。您如何敢于忍受怨恨或另一个群体的怨恨？既然这条路是一条山路，谁会告诉您道路，谁能与您接近？','希望尚未解决的疑问。骑山路的道路多么艰难和困难。我年轻的时候我会再次失去很多东西，所以我做不到。你不应该结束道路吗？','我四处走动，看着天空，所以我会在最后的道路上得到财富。如果不以后，您将戴祝福。财富在路上，所以你可以得到它。如果您看到它，请随时去获取它。','我在cheonri ta hwang中一直很孤独和孤独，所以我想成为拐杖。但是不要相信别人。相反，您会看到一个幸福的梦。不要关闭东西方。损失始于损失，最后要小心。','月亮进入乌云，使得很难区分东西方，西部和南部。如果您不是个人的，那么您会小心，因此请小心您的健康，并很好地看待您的房屋。注意不要受伤，因为人们会嫉妒我的工作。','西方和北部的两面都必须丑陋，因此在完成工作时要小心。东西方房间会很好，因此您应该开始工作并查看尽头。水的肉从海中熄灭，因此尾巴将是扬阳和愉快的。','当我去山上擦干路时，我的生活看起来像这样。东南房间很长，所以当您开始和扔掉时，您必须刺激。但是要小心你的继任者。可怕的是门外的一瞥。如果仔细，可以避免它。','如果您与他人合作，您将失败。工作有很多摩擦，因此离开莫莉或制定一个很好的计划是不利的。没有原始的财富，您将围绕身体，您将不得不知道。','请注意，人们将因其不良成绩而损失钱。然而，有必要知道利润也是人际关系，因为它们不会通过忽视关系而获得盈利。如果您得到他人的帮助，您将能够获得不同的奖品。','不要出门或尝试在外面工作。将会有损失，没有利润。欢乐和焦虑混合在一起，所以流浪汉又丑陋。你必须工作得很好。艾尔辛（Ilshin）臭名昭著，内心深处很困扰，但不要在外面表达，也不与他人合作。','在秋天的春天，我会想到我的房子，并考虑一下。如果您在不保留喷泉的情况下这样做，那么如果您保持喷泉而不是和平，则可以避免此数字。来东部的客人一定是邪恶的人，所以不要一起工作。','由于太阳在Seosan，因此揭示了回到路的方式。你必须快点。实现失明并不容易，因此它将是保持喷泉的最佳目的地。如果不是水，则不会破碎结构，因此您必须保留喷泉。','如果您尝试获得财富，可以得到它。作者的运气很忙，但是很难从中受益，以至于有必要保证和满足。房子里有一个投诉，必须手写，所以我必须避免作为祈祷。','2025-03-02 11:57:20.396773+00','c');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (480,'040','乾いたドラゴンはついに水を得るので、運は無限であり、問題なく尊敬されます。ただし、どの場所にも飛び込まないでください。山道や炎を歩かなければならないことを忘れないでください。たくさんのアイデアがあるので、誰が次々と内なる心を知るでしょうか？しかし、最初は難しいので、あなたは後ろで繁栄するので、たとえあなたが増えても富を得るでしょう。喜びと不安は上半分なので、ギルも上半分です。笑いと泣き声は人生です。時折統治と統合があるので、これは醜いでしょう。 grみや他のグループのgrみをどうやって我慢しますか？道路は山道なので、誰があなたに道を教えてくれますか、誰があなたと一緒に近づくことができますか？','希望がまだ解決されていないという疑いは何ですか。山道に乗る道はどれほど厳しく、困難です。私が若いときに再び多くを失うので、できません。でも道路を終えるべきではありませんか？','私は歩き回って空を見るので、最後の方法で豊かになります。後でない場合は、祝福を着用します。富は道にいるので、あなたはそれを手に入れることができます。あなたがそれを見たら、遠慮なく行ってそれを手に入れてください。','私はチョンリ・タ・ファンで孤独で孤独だったので、杖になりたいです。しかし、他の誰かを信じないでください。それどころか、あなたは幸せな夢を見るでしょう。東と西を閉じないでください。損失は損失から始まり、終わりに注意してください。','月は黒い雲に入り、東、西、南を区別することが困難になりました。あなたが個人的でない場合は、注意してください。あなたの健康に注意して、あなたの家をよく見てください。人々が私の仕事に嫉妬するので、怪我をしないように注意してください。','西と北の両側はugいなければならないので、作業を終えるときは注意してください。東と西の部屋は良いので、仕事を始めて最後を見る必要があります。水の肉は海から出ているので、尾はヤンヤンで楽しいものになります。','私が山に行って道を拭いたとき、私の人生はこのように見えました。南東部の部屋は長いので、始めて捨てるときに拍車をかける必要があります。しかし、あなたの後継者に注意してください。怖いのはドアの外で垣間見ることです。慎重に避けることができます。','他の人と一緒に仕事をすると、失敗します。仕事には多くの摩擦があるので、モリーを離れたり、素晴らしい計画を立てるのは不利です。元の富がなければ、あなたは体の周りにいます、そしてあなたはそれを知る必要があります。','悪い結果の結果として人々はお金を失うことに注意してください。それにもかかわらず、利益は人間関係も人間関係であることを知る必要があります。あなたが他の人に助けられれば、あなたは異なる賞品を得ることができるでしょう。','外に出ないで、外で仕事をしようとしないでください。損害があり、利益はありません。喜びと不安が混ざり合っているので、お尻は長く醜いです。あなたはうまく働かなければなりません。イルシンは悪名が高く、心臓に非常に悩まされていますが、外で表現せず、他の人と一緒に働いていません。','秋の春に、私は私の家のことを考えて、それについて考えます。噴水を維持せずにそうする場合は、噴水を平和ではなく維持すると、この数を避けることができます。東に来るゲストは必然的に邪悪な人々なので、一緒に働かないでください。','太陽はソーサンにあるので、道に戻る方法が明らかになります。あなたは急いでいる必要があります。失明を達成するのは簡単ではないので、噴水を維持するのに最適な目的地になります。それが水でない場合、建設は壊れないので、噴水を維持する必要があります。','あなたが富を得ようとするなら、あなたはそれを得ることができます。著者の運は非常に忙しいので、利益を得ることは困難ですので、あなたは誓約され、満足する必要があります。家に苦情があり、手書きでなければならないので、私はそれを祈りとして避けなければなりません。','2025-03-02 11:57:20.396773+00','j');
